package main

import "fmt"

func main() {
	fmt.Println(findRepeatedDnaSequences("AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"))
	fmt.Println(findRepeatedDnaSequences("AAAAAAAAAAAA"))
	fmt.Println(findRepeatedDnaSequences(""))
}

const mapKeyLen = 4

var ss []string

func findRepeatedDnaSequences(s string) []string {
	ss = []string{}
	l := len(s)
	m := make(map[string][]int)
	for i := 0; i <= l - 10; i++ {
		key := s[i:i + mapKeyLen]
		list, ok := m[key]
		if ok {
			for _, v := range list {
				checkRepeated(s, v, i)
			}
			m[key] = append(m[key], i)
		} else {
			m[key] = []int{i}
		}
	}

	return ss
}

func checkRepeated(s string, i, j int) {
	k := mapKeyLen
	for true {
		if k == 10 {
			find := false
			as := s[i:i + 10]
			for _, v := range ss {
				if v == as {
					find = true
					break
				}
			}
			if !find {
				ss = append(ss, as)
			}
			break
		}
		if s[i + k] == s[j + k] {
			k++
		} else {
			break
		}
	}
}

func findRepeatedDnaSequences1(s string) []string {
	l := len(s)
	var ss []string
	for i := 0; i <= l - 10; i++ {
		for j := i + 1; j <= l - 10; j++ {
			k := 0
			for true {
				if k == 10 {
					find := false
					as := s[i:i + 10]
					for _, v := range ss {
						if v == as {
							find = true
							break
						}
					}
					if !find {
						ss = append(ss, as)
					}
					break
				}
				if j + k >= l {
					break
				}
				if s[i + k] == s[j + k] {
					k++
				} else {
					break
				}
			}
		}
	}

	return ss
}
